import { MenuItem, SelectField, TextField } from 'material-ui'
import React, { Component } from 'react'

export default class Search extends Component {
    state = {
        searchText:'',
        amount:15,
        apiUrl: 'https://pixabay.com/api',
        apiKey:'20872776-9cea79aa18fbdc0e4fa86e248',
        images:[]
    }
    render() {
        return (
            <div>
                <TextField 
                name="searchText"
                value={this.state.searchText}
                onChange={this.onTextChange}
                floatingLabelText="Search For Images"
                fullWidth={true}/>
                <br/>

               

        <SelectField 
        name="amount"
        floatingLabelText="Amount" 
        value={this.state.amount} 
        onChange={this.onAmountChange}>
            <MenuItem value={5} primaryText=""/>
            <MenuItem value={10} primaryText=""/>
            <MenuItem value={15} primaryText=""/>
            <MenuItem value={20} primaryText=""/>
            <MenuItem value={25} primaryText="15"/>

        </SelectField>
                
            </div>
        )
    }
}
